    <>
    <ul>
        <li>{add(30,3)}</li>
        <li>{sub(40-9)}</li>
        <li>{mult(82*2)}</li>
        <li>{div(33/3)}</li>
    </ul>
    </>,
    document.getElementById("root")
);
